import React from "react";
import Chip from "../Chip/Chip";

const ChipList = ({ chipData }) => {
  return (
    <div>
      {chipData.map((item) => (
        <Chip chipTitle={item} />
      ))}
      console.log(chipData, "chipData");
    </div>
  );
};

export default ChipList;
